import React, { useState } from 'react'

function TesHoo() {
  const [techs, setTechs] = useState(['ReactJS', 'React native'])

  function handleAdd() {
    alert('ok')
    setTechs([...techs], 'Node.js')
  }

  return (
    <>
      <ul>
        {techs.map((tech) => (
          <li key={tech}>{tech}</li>
        ))}
      </ul>
      <button onClick={handleAdd}>Adicionar</button>
    </>
  )
}

export default TesHoo
